import './App.css';
import Header from './components/Header/Header';
import { Routes, Route, Link } from 'react-router-dom'
import { Fake } from './components/Fake/Fake'


function App() {
	return (
		<div className="App">
			<div className='header'>
				<Header />
			</div>
			<div className='left-block'>search + active contact</div>
			<div className='right-block'>
				<Routes>
					<Route path='/home' element={<Fake />} />
					<Route path='/chat' element={<Fake />} />
					<Route path='/contacts' element={<Fake />} />
					<Route path='/settings' element={<Fake />} />
					<Route path='/faq' element={<Fake />} />
				</Routes>
			</div>
		</div>
	);
}

export default App;
